description:
A sensuous and self-exploratory collaboration between 5 pairs of nft artists,
@evrythngissoft,@Sebuh_com,@PhoneCamBoi12,@Emaniak_NFT,@LukeBeckCG's as they mint and sell images of their own personal feet for a bribe of 3xtz each by @twigwam on twitter.  this commemorative collage was generated with microsoft 3d paint and the rectangles were organized by @twigwam to show great appreciation for all the beautiful feet. It was very much my personal pleasure. ☺️

(((nothinbutlove)))
